using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;


namespace BA1D
{
    class Program
    {
        static void Main(string[] args)
        {
            string p = "GTCTCGTGT";
            string g = "";
            List<int> lista = new List<int>();
            for (int i = 0; i < g.Length - p.Length; i++)
            {
                if (g.Substring(i, p.Length) == p)
                {
                    lista.Add(i);
                }
            }
           

            for (int i = 0; i < lista.Count; i++)
            {
                Console.Write(lista[i] + " ");
            }
            Console.ReadLine();
        }
    }
}
